(1, 'Kontakt', '<p>Nev&iacute;te si s něč&iacute;m rady? M&aacute;te nějak&yacute; dotaz? Nebojte se mě kontaktovat.</p>\n<p><strong>E-Mail:</strong> <a href="mailto:jdc@2ne1.cz">jdc@2ne1.cz</a><br /><strong>Facebook:</strong> <a href="https://www.facebook.com/officialJDC" target="_blank">JDCofficial</a><br /><strong>Twitter:</strong> <a href="http://www.twitter.com/JarDacan" target="_blank">@JarDacan</a></p>\n<p><a href="http://www.2ne1.cz" target="_blank">www.2ne1.cz</a><br /><a href="http://jdc.2ne1.cz" target="_blank">jdc.2ne1.cz</a><br /><a href="http://www.asianstyle.cz/profil/jdc" target="_blank">www.asianstyle.cz/profil/jdc</a></p>\n<h2>Spr&aacute;vci syst&eacute;mu</h2>\n<p>JDC - hlavn&iacute; administr&aacute;tor, DJ<br />Syrinox - asistentka</p>\n<p style="text-align: center;"><a href="https://www.facebook.com/officialJDC" target="_blank"><img src="http://icons.iconarchive.com/icons/danleech/simple/64/facebook-icon.png" alt="" /></a> <a href="http://www.twitter.com/JarDacan" target="_blank"><img src="http://icons.iconarchive.com/icons/danleech/simple/64/twitter-icon.png" alt="" /></a> <a href="https://plus.google.com/u/0/+JaroslavJDCVojt&iacute;&scaron;ek" target="_blank"><img src="http://icons.iconarchive.com/icons/danleech/simple/64/google-plus-icon.png" alt="" /></a> <a href="http://www.youtube.com/user/cunoryp" target="_blank"><img src="http://icons.iconarchive.com/icons/danleech/simple/64/youtube-icon.png" alt="" /></a></p>', '', 'kontakt'),
(2, 'Homepage', '<h2>Chcete sly&scaron;et svou obl&iacute;benou p&iacute;sničku na př&iacute;&scaron;t&iacute; Asian Style party?</h2>\n<p>Dal&scaron;&iacute; AsianStyle p&aacute;rty se už z&aacute;vratně bl&iacute;ž&iacute;! A co to znamen&aacute;? Nejen, že se budete moci &uacute;častnit t&eacute;to velk&eacute; přby v asijsk&eacute;m stylu, ale tak&eacute; můžete přispět do DJova playlistu, kter&yacute; teď přich&aacute;z&iacute; v <strong>nov&eacute; nale&scaron;těn&eacute; verzi!</strong></p>\n<p>O novink&aacute;ch v playlistu se můžete <a href="http://cwjp.2ne1.cz/spusten-dj-jdcs-playlist-songator-2-0-beta/" target="_blank"><strong>doč&iacute;st zde</strong></a>. Jako nov&eacute; kl&iacute;čov&eacute; funkce jsou na&scaron;ept&aacute;vač songů a interpetů u přid&aacute;vac&iacute;ho formul&aacute;ře a nyn&iacute; tak&eacute; můžete <strong>lajkovat songy</strong> a t&iacute;m je podpořit. Zv&yacute;&scaron;&iacute;te t&iacute;m &scaron;anci, že song bude zařazen. Po určit&eacute;m počtu (ten je zat&iacute;m tajn&yacute; :P) je song označen jako srdcovka a je <strong>t&eacute;měř na</strong> <strong>100% jist&eacute;, že bude zařazen. <br /></strong>Je&scaron;tě bych měl podotknout, že pro lajkov&aacute;n&iacute; songů <strong>NEN&Iacute; NUTN&Eacute; SE REGISTROVAT ANI PŘIHLA&Scaron;OVAT</strong>.</p>\n<p>DJ JDC se v r&aacute;mci zpětn&eacute; vazby a zlep&scaron;ov&aacute;n&iacute; opět rozhodl d&aacute;t prostor zase V&Aacute;M! Prostřednictv&iacute;m tohoto mal&eacute;ho port&aacute;lu můžete d&aacute;t DJovi tipy na songy, kter&eacute; byste r&aacute;di na AS p&aacute;rty sly&scaron;eli a zatančili si na ně. Stač&iacute; k tomu jedin&eacute; - <strong><a href="song/add">Poslat v&aacute;&scaron; tip přes n&aacute;&scaron; formul&aacute;ř!</a></strong></p>\n<p>Pro v&iacute;ce informac&iacute; ohledně DJova playlistu sledujte <a href="https://www.facebook.com/officialJDC" target="_blank">JDC''s ofici&aacute;ln&iacute; Facebook</a> (dejte mu lajk, uděl&aacute;te mu t&iacute;m radost a zachr&aacute;n&iacute;te život dvaceti kočičk&aacute;m a třem tis&iacute;cům stromů :P) a pro v&scaron;eobecn&eacute; informace ohledně p&aacute;rty sledujte server <a href="http://www.asianstyle.cz" target="_blank">AsianStyle.cz</a></p>\n<p>V ned&aacute;vn&eacute; době tak&eacute; proběhl <a href="http://www.asianstyle.cz/ostatni/10847-narozeninova-asianstyle-party-zpetna-vazba-pro-dje" target="_blank">průzkum zpětn&eacute; vazby</a> na posledn&iacute; 3 konan&eacute; AsianStyle p&aacute;rty a na DJovo hran&iacute;, kter&eacute;ho jste se mohli &uacute;častnit. Dotazn&iacute;&iacute;k byl uzavřen a brzy budou zveřejněny v&yacute;sledky.</p>\n<h3><span style="color: #ff0000;"><strong><span style="color: #008000;">Playlist otevřen! Můžete přid&aacute;vat songy, jak je libo. Tě&scaron;&iacute;m se na V&aacute;s na AS p&aacute;rty :)</span><br /></strong></span></h3>\n<p><span style="color: #ff0000;"><strong><span style="color: #ff9900;">Lajkov&aacute;n&iacute; songů resetov&aacute;no (Obnoveno po &uacute;toku robotů)</span><br /></strong></span></p>', '', 'homepage'),
(3, 'Podmínky pro přidání songu', '<p>Zde můžete přidat do n&aacute;vrhu playlistu song, na kter&yacute; byste si r&aacute;di zatančili kter&yacute; byste r&aacute;di sly&scaron;eli na AsianStyle party. DJovi můžete je&scaron;tě pomoci t&iacute;m, že u va&scaron;eho tipu na sonng uvdete odkaz k poslechnut&iacute;, např&iacute;klad odkaz na Youtube. Song mus&iacute; splňovat n&aacute;sleduj&iacute;c&iacute; podm&iacute;nky:</p>\n<ul>\n<li>Song je ž&aacute;nru asijsk&eacute; hudby (<strong>K-POP, J-POP, C-POP, Thai Pop</strong> a jin&aacute; asijsk&aacute; hudba)</li>\n<li>Na song <strong>se mus&iacute; d&aacute;t tancovat</strong>, nesm&iacute; b&yacute;t utahan&yacute;, nudn&yacute;, aby n&aacute;m neut&iacute;kali lidi z parketu</li>\n<li>Pomalej&scaron;&iacute; songy jsou dovoleny, ale mus&iacute; se na ně d&aacute;t tancovat. Pomalej&scaron;&iacute; songy <strong>nebudou br&aacute;ny přednostně</strong></li>\n<li>Pokud song bude nevhodn&yacute;, DJ m&aacute; pr&aacute;vo jej <strong>z playlistu vyřadit</strong></li>\n<li>N&aacute;zvy songů a jm&eacute;na interpretů pi&scaron;te pros&iacute;m v <strong>ROMANIZOVAN&Eacute;M</strong> přepise, př&iacute;padně jejich <strong>ANGLICK&Yacute;M</strong> n&aacute;zvem</li>\n<li>Do odkazu k poslechu<strong> ned&aacute;vejte odkaz ke stažen&iacute;</strong>. Song s pochybn&yacute;m odkazem bude smaz&aacute;n.</li>\n<li>DJ nemůže na 100% zaručit, že zahraje v&scaron;echny songy v playlistu. Noc je dlouh&aacute;, ale bohužel času nen&iacute; zase tolik, aby se to za jednu noc v&scaron;echno dalo stihnout zahr&aacute;t. Pokud chcete sly&scaron;et va&scaron;&iacute; obl&iacute;benou p&iacute;seň, nechte si ji zahr&aacute;t jako<strong> p&iacute;seň na př&aacute;n&iacute;</strong> u DJe př&iacute;mo na p&aacute;rty.</li>\n<li><span style="color: #ff0000;">Před přid&aacute;n&iacute;m songu <strong>zkontrolujte, zda se už song nenach&aacute;z&iacute; v na&scaron;em <a href="../../../song/list">seznamu</a>. DUPLICITY BUDOU MAZ&Aacute;NY! <span style="text-decoration: underline;">Za spamov&aacute;n&iacute; duplicitami v&aacute;m může b&yacute;t znemožněno přid&aacute;v&aacute;n&iacute; songů!</span><br /></strong></span></li>\n<li>Přid&aacute;n&iacute;m songu <strong>souhlas&iacute;te</strong> s jeho zařazen&iacute;m do DJova playlistu a zahr&aacute;n&iacute;m na AsianStyle party</li>\n</ul>', '', 'add'),
(4, 'About DJ', '<p><img style="display: block; margin-left: auto; margin-right: auto;" src="https://scontent-b-cdg.xx.fbcdn.net/hphotos-prn2/t1/1538837_565227476894285_1133088857_n.jpg" alt="" width="450" /></p>\n<p>Kdo je vlastně ten DJ JDC? Mysl&iacute;m, že odpově na tuto ot&aacute;zku neuhodnete, jelikož je to člověk, jako každ&yacute; jin&yacute;. A nebo ne? Každop&aacute;dně ať už je co je, hudbu prostě miluje, a už je jak&eacute;hokoli druhu. Nejraději m&aacute; ov&scaron;em tu asijskou a proto se ve sv&eacute;m voln&eacute;m čase věnuje hran&iacute; asijsk&eacute; hudby na AsianStyle p&aacute;rty. Pokud se někdy přijdete pod&iacute;vat, ať už ze zvědavosti, nebo si jen tak zatancovat, zajist&eacute; usy&scaron;&iacute;te K-POP, C-POP, J-POP, Thai-Pop a dal&scaron;&iacute; asijsk&eacute; ž&aacute;nry a styly.</p>\n<p style="text-align: center;"><a href="https://www.facebook.com/officialJDC" target="_blank"><img src="http://icons.iconarchive.com/icons/danleech/simple/64/facebook-icon.png" alt="" /></a> <a href="http://www.twitter.com/JarDacan" target="_blank"><img src="http://icons.iconarchive.com/icons/danleech/simple/64/twitter-icon.png" alt="" /></a> <a href="https://plus.google.com/u/0/+JaroslavJDCVojt&iacute;&scaron;ek" target="_blank"><img src="http://icons.iconarchive.com/icons/danleech/simple/64/google-plus-icon.png" alt="" /></a> <a href="http://www.youtube.com/user/cunoryp" target="_blank"><img src="http://icons.iconarchive.com/icons/danleech/simple/64/youtube-icon.png" alt="" /></a></p>\n<p>&nbsp;</p>\n<div id="mcePasteBin" style="position: absolute; top: 119px; left: 0; background: red; width: 1px; height: 1px; overflow: hidden;" contenteditable="false">\n<div contenteditable="true">X</div>\n</div>', '', 'dj'),
(5, 'About AsianStyle party', '<p>sdfad</p>', '', 'asparty');
